import { useState } from "react";

const Home = () => {

  let [blogs, setBlogs] = useState([
    { title: "Hello world!", body: "", author: "Gnome", id: 1 },
    { title: "My name is ACF", body: "", author: "Foo", id: 2 },
    { title: "MISA", body: "", author: "Blob", id: 3 }
  ]);

  return (
    <div className="home">
      <h2>Homepage</h2>
      {blogs.map((blog) => 
        (<div className="blog-view" key={blog.id}>{blog.content}</div>)
      )}
    </div>
  );
}

export default Home;
